import React from "react";
import Header from "../header2/Header";
import { motion } from "framer-motion";

const BrandingConsulting = () => {
  return (
    <>
      <section className="section-top">
        <Header />
        <div className="branding-consulting-banner">
          <img
            className="img-fluid w-100"
            src="assest/photos/branding/branding-consulting-banner.png"
            alt="G-Rank"
          />
          <div className="branding-cunsulting-banner-new-div">
            <h1>
              <span class="words2"></span>
            </h1>

            <motion.h3
              href="#"
              initial={{ opacity: 0, scale: 0 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6 }}
            >
              <a href="#">Get Started</a>
            </motion.h3>
          </div>
          <motion.h5
            initial={{ opacity: 0, scale: 0 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 1 }}
          >
            Stand out with us.
          </motion.h5>
          <h4>
            Creating innovative branding that breaks free of <br />
            convention leaves a lasting impression on customers.
          </h4>
        </div>
      </section>
    </>
  );
};

export default BrandingConsulting;
